function eae(conteudo) {
    var resultado = []
    var x = 0
    for(var i in conteudo){
        if( Object.values(conteudo)[x]){
    resultado.push(i +"= " +Object.values(conteudo)[x]);
    }
    x++
}
return resultado
}

function Informacoes(props){
console.log(props)    
    return(
        <div>
            {
